import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <>
      <header>
        <h3>Halfwayhome</h3>
        <nav>
          <Link to="/">Home</Link>
          <Link to="/">Home design</Link>
          <Link to="/">Blog</Link>
          <Link to="/">Sign In</Link>
        </nav>
      </header>
    </>
  );
};

export default Header;
